import * as React from "react";
import { Layout } from "../../components";
import { useRouter } from "next/router";

export default function SearchQuery() {
  const router = useRouter();
  const { searchQuery } = router.query;
  return (
    <React.Fragment>
      <Layout></Layout>
      <main>{searchQuery}</main>
    </React.Fragment>
  );
}
